Nintendo releases a Mario kart game on the phone and suddenly it’s “cool and trendy, maybe even quirky” to like Nintendo. They out here saying things like “I’d destroy you in Mario Kart!” Bitch please, the only Mario Kart you’ve played is WII and it’s been 4 years. People like me get bullied for it all the time because “Nintendo is for kids” and now everyone loves it for like a week and then move on. It’s not fair at all. Why do people have to just follow along with what’s popular. I have put so much time and effort into Mario Kart and practice the perfect turns and everything like that. And when something I love gets popular like it is now I’m just ignored because suddenly everyone is an expert. I get bullied so much for it. Even at school people would make fun of me and my friends for having Nintendo and enjoying it more than Playstaion
